// src/Dashboard.jsx
export default function Dashboard({ user, commissionData, violationData }) {
  if (!user) return <div>Unauthorized</div>;

  const userCommissions = commissionData.filter(
    (entry) =>
      entry.Agent?.toLowerCase() === user.name.toLowerCase() ||
      entry.Name?.toLowerCase() === user.name.toLowerCase()
  );

  const userViolations = violationData.filter(
    (entry) =>
      entry.Agent?.toLowerCase() === user.name.toLowerCase() ||
      entry.Name?.toLowerCase() === user.name.toLowerCase()
  );

  return (
    <div style={{ padding: 20 }}>
      <h2>Welcome, {user.name}</h2>

      <h3>Your Weekly Commission</h3>
      <pre>{JSON.stringify(userCommissions, null, 2)}</pre>

      <h3>Your Scanning Violations & ARs</h3>
      <pre>{JSON.stringify(userViolations, null, 2)}</pre>
    </div>
  );
}
